import styled from "styled-components";
const SearchBar = styled.div`
display: flex;
flex-direction: row;
justify-content: center;
align-items: center;
padding: 4px 4px 4px 16px;
background: #FFFFFF;
border: 1px solid #E0E2EB;
box-sizing: border-box;
border-radius: 4px;
`;

const SearchText = styled.div`
display: flex;
flex-direction: row;
justify-content: center;
align-items: center;
padding: 4px 4px 4px 16px;
margin: 12px 16px;
height: 48px;
background: #FFFFFF;
border: 1px solid #E0E2EB;
box-sizing: border-box;
border-radius: 4px;
`;
export const Search: React.FC = () => {
  return (
   <SearchBar><SearchText>Search by keyword</SearchText></SearchBar>
  )
}
